BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "inspectserver_refdocuments" (
	"id"	integer NOT NULL,
	"RefDocumentName"	varchar(100) NOT NULL,
	"RefDocumentVersion"	varchar(10) NOT NULL,
	"RefDocumentPath"	varchar(100),
	"RefDocumentAuthor"	varchar(100) NOT NULL,
	"RefDocumentDate"	datetime NOT NULL,
	"DocumentType_id"	bigint,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("DocumentType_id") REFERENCES "inspectserver_documenttype"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE INDEX IF NOT EXISTS "inspectserver_refdocuments_DocumentType_id_1702f685" ON "inspectserver_refdocuments" (
	"DocumentType_id"
);
COMMIT;
